    <div className="VerticalMenu">
      <h3 className="LabelMenu">{title}</h3>
      <ul className="ItemList">
        {categoryList.map((category,index) => {
          return <li>{category.title}</li>;
        })}
        
      </ul>
      <div className="BorderLv1"></div>
      <div className="BorderLv2"></div>
    </div>
  );
}

